import React from "react";
import "./App.css";
import Explorer from "./Explorer.js";
import { data } from "./folder-structure";

function App() {
  return (
    <>
      {data.map((item, index) => {
        return <Explorer key={index} folderItems={item} />;
      })}
    </>
  );
}

export default App;
